DROP TABLE IF EXISTS `film`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `film` (
  `film_id` bigint NOT NULL,
  `title` text,
  `release_year` bigint DEFAULT NULL,
  `language_id` bigint DEFAULT NULL,
  `rental_duration` bigint DEFAULT NULL,
  `category_id` bigint DEFAULT NULL,
  `rental_price` bigint DEFAULT NULL,
  `length` bigint DEFAULT NULL,
  `replacement_price` text,
  `rating_id` bigint DEFAULT NULL,
  `special_features` text,
  PRIMARY KEY (`film_id`),
  KEY `fromFilmToLanguage_idx` (`language_id`),
  KEY `fromFilmToCategory_idx` (`category_id`),
  KEY `fromFilmToRating_idx` (`rating_id`),
  CONSTRAINT `fromFilmToCategory` FOREIGN KEY (`category_id`) REFERENCES `category` (`category_id`),
  CONSTRAINT `fromFilmToLanguage` FOREIGN KEY (`language_id`) REFERENCES `language` (`language_id`),
  CONSTRAINT `fromFilmToRating` FOREIGN KEY (`rating_id`) REFERENCES `mpa_rating` (`rating_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
